//import plugin
import React from 'react';
import { Link } from "react-router-dom";

//import style
import "../style/nomatch.css"
import Navbar from "../component/navbar"
import Header from "../component/header"
import "../style/home.css"
import Category from '../component/navbarCategory';
import Search from '../component/search'

// untuk mengembalikan respon saat tidak ditemukan page yang sesuai
class ListProduct extends React.Component{
    render(){
        return(
            <nav>
                <Navbar/>
                <Category/>
                <Search/>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-3 product">
                            <img className="image-product" src={require("../image/miee.jpeg")} alt=""/>
                            <p className="name-product">Mie Yabi</p>
                            <p className="title-rating">Rate</p>
                            <p className="weight-product">60gr</p>
                            <p className="rating-product">(7/10)</p>
                            <p className="seller-product">Hedy</p>
                            <p className="stock">stock: </p>
                            <p className="stock-product">12</p>
                            <div>
                                <p className="price">Rp. 4000 /</p>
                                <p className="reference">wrap</p>
                            </div>
                            <img className="halal" src={require("../image/halal.png")} alt=""/>
                            {this.props.is_login ?
                                (<img className="halal" src={require("../image/miee.jpeg")} alt=""/>):(<nav></nav>)
                            }
                            <button type="button" class="btn btn-primary add-to-cart">Add to cart</button>
                        </div>
                    </div>
                </div>
            </nav>
        )
    }
}

//mengeksport class NotMatch ke main-route.js
export default ListProduct;
